import Layout from "../components/layout/layout";

function Dashboard() {
  const position = { topbar: "flex gap-5" };
  const design = { topbar: "font-medium *:cursor-pointer" };

  function isActive(e) {
    const siblings = e.target.parentNode.children;
    [...siblings].forEach((sibling) =>
      sibling.classList.remove("text-gray-500"),
    );
    e.target.classList.add("text-gray-500");
  }

  return (
    <Layout>
      <div className={`${position.topbar} ${design.topbar}`}>
        <p onClick={(e) => isActive(e)}>Profile</p>
        <p onClick={(e) => isActive(e)}>Inbox</p>
        <p onClick={(e) => isActive(e)}>Orders</p>
        <p onClick={(e) => isActive(e)}>Favourites</p>
        <p onClick={(e) => isActive(e)}>Settings</p>
      </div>
      <div>
        <Profile />
      </div>
    </Layout>
  );
}

export default Dashboard;

function Profile() {
  const user = JSON.parse(sessionStorage.getItem("user"));
  console.log(user[0].created);
  return (
    <div>
      <img src="" alt="profile image" />
      <h3>
        {user[0].fname} {user[0].lname}
      </h3>
      <p>Member Since </p>
    </div>
  );
}

